import React from 'react';
import Person from '../assets/Person';
import Note from '../assets/Note';

const Home: React.FC = () => {
	return (
		<div className='container-fluid'>
			<div className='row'>
				<div className='col-md-3'>
					<div className=''>
						<Person />
					</div>
				</div>
				<div className='col-md-6'></div>
				<div className='col-md-3'>
					<div className=''>
						<Note />
					</div>
				</div>
			</div>
		</div>
	);
};

export default Home;
